// empty file
// 1 byte file
// 1 byte less than full buffer
// 1 full buffer
// 1 full buffer + 1
// long

// {"empty", 0},
// {"onebyte", 1},
// {"onelessthanone", 1023},
// {"onebuffer", 1024},
// {"onebufferplusone", 1025},
// {"long", 35538},

const bufferSize = 1024

func TestBufferEmptyFileWithGet(t *testing.T) {
	t.Log("start TestBufferEmptyFileWithGet")
	hb := NewHashBuffer("./testdata/empty", bufferSize)
	hb.SetTesting(t)
	defer hb.Close()
	testGet(t, hb, "TestBufferEmptyFileWithGet first round", 16, testData[0:0])
	testGet(t, hb, "TestBufferEmptyFileWithGet second round", 16, testData[0:0])
	testGetNext(t, hb, "TestBufferEmptyFileWithGet third round", false)
}

func TestBufferEmptyFileWithGetNext(t *testing.T) {
	t.Log("start TestBufferEmptyFileWithGetNext")
	hb := NewHashBuffer("./testdata/empty", bufferSize)
	hb.SetTesting(t)
	defer hb.Close()
	testGetNext(t, hb, "TestBufferEmptyFileWithGetNext first round", false)
	testGetNext(t, hb, "TestBufferEmptyFileWithGetNext second round", false)
}

func TestBufferOneByteFileWithGet(t *testing.T) {
	t.Log("start TestBufferOneByteFileWithGet")
	hb := NewHashBuffer("./testdata/onebyte", bufferSize)
	hb.SetTesting(t)
	defer hb.Close()
	testGet(t, hb, "TestBufferOneByteFileWithGet - Get round", 16, testData[0:1])
	testGetNext(t, hb, "TestBufferOneByteFileWithGet - GetNext round", false)
}

func TestBufferOneLessThanOneFileWithGet(t *testing.T) {
	t.Log("start TestBufferOneLessThanOneFileWithGet")
	hb := NewHashBuffer("./testdata/onelessthanone", bufferSize)
	hb.SetTesting(t)
	defer hb.Close()
	testGet(t, hb, "TestBufferOneLessThanOneFileWithGet first round", 16, testData[0:16])
	for i := 16; i <= 1022; i++ {
		outByte, ok := testGetNext(t, hb, "TestBufferOneLessThanOneFileWithGet second round", true)
		t.Logf("index %d  val %#x (%s)  ok %t", i, outByte, string(outByte), ok)
	}
	testGetNext(t, hb, "TestBufferOneLessThanOneFileWithGet third round", false)
}

func testGet(t *testing.T, hb HashBuffer, title string, amountToGet int, expected []byte) { // string may be multiple bytes / rune
	t.Logf("starting %s", title)
	buf, count := hb.Get(amountToGet)
	expectedLength := len(expected)
	if count != expectedLength {
		t.Errorf("Error %s :got count=%d, want %d", title, count, expectedLength)
	}
	if amountToGet == 0 {
		if buf != nil {
			t.Errorf("Error %s: got buf[] with length=%d, want buf == nil", title, len(buf))
		}
	} else {
		len := len(buf)
		if len != expectedLength {
			t.Errorf("Error %s: got length=%d, want %d", title, len, expectedLength)
		} else {
			for index, element := range expected {
				if element != buf[index] {
					t.Errorf("Error %s: unexpected value %#x (%s), want %#x (%s)", title, buf[index], string(buf[index]), element, string(element))
					break
				}
			}
		}
	}
}

func testGetNext(t *testing.T, hb HashBuffer, title string, byteExpectedInReturn bool) (byte, bool) {
	t.Logf("starting %s", title)
	outByte, ok := hb.GetNext()
	if byteExpectedInReturn {
		if !ok {
			t.Errorf("Error %s: got ok=false, want ok=true", title)
		}
	} else {
		if ok {
			t.Errorf("Error %s: got ok=true, want ok=false", title)
		}
		if outByte != 0 {
			t.Errorf("Error %s: got outByte=%d (%s), want 0", title, outByte, string(outByte))
		}
	}
	return outByte, ok
}

